Potem ko začnete svojo pot, sistem s pomočjo podatkov o navoru motorja oceni skupno maso vašega vozila in prikolice. Če bi lahko ocenjena masa presegla največjo bruto skupno maso vozila, vas sistem o tem opozori. Ocenjena masa se lahko razlikuje od dejanske mase. Opozorilo ne upošteva mase obremenjenega vozila ali prikolice.

To opozorilo se aktivira samo, če:
• je funkcija vklopljena v aplikaciji Vleka;
• je na voljo dovolj dogodkov pospeševanja, da lahko sistem oceni skupno maso vozila in prikolice;
• lahko ocenjena masa preseže največjo bruto skupno maso vozila.

Če se prikaže opozorilo, varno ustavite vozilo in preverite (stehtajte), ali sta vozilo in prikolica morda preobremenjena.

Opozorilo:
• Dejansko maso obremenjenega vozila in prikolice vedno preverite, preden se podate na pot.
• Opozorila o bruto skupni masi ne uporabljajte za preverjanje, ali sta vozilo in prikolica pravilno obremenjena oziroma preobremenjena.
• Ne vozite, če je vozilo ali prikolica preobremenjena, saj lahko tako povzročite smrt, hude telesne poškodbe ali poškodbe lastnine.

Največja bruto skupna masa je samo eno od meril za določanje obremenitve vašega vozila in prikolice. Z opozorilom o bruto skupni masi ni mogoče oceniti, ali:
• vozilo presega največjo bruto maso vozila (NBMV);
• masa zadnje osi presega največjo bruto obremenitev zadnje osi;
• prikolica presega največjo dovoljeno maso prikolice;
• masa vlečnega droga prikolice presega največjo dovoljeno maso vlečnega droga.

Vedno preverite, da masa vozila, tovora vozila, prikolice, tovora prikolice in vlečnega droga prikolice ne presega teh vrednosti obremenitev.

Največja bruto skupna masa je samo eno od meril za določanje obremenitve vašega vozila in prikolice. Z opozorilom ni mogoče oceniti, ali:
• vozilo presega največjo bruto maso vozila (NBMV);
• masa zadnje osi presega največjo bruto obremenitev zadnje osi;
• prikolica presega največjo dovoljeno maso prikolice;
• masa vlečnega droga prikolice presega največjo dovoljeno maso vlečnega droga.

Poskrbite, da:

• bo vozilo vklopljeno;
• bo menjalnik v parkirnem položaju (P);
• zavore ne bodo aktivirane;
• bodo varnostne utripalke in smerniki izklopljeni.

S tem dejanjem boste:
• znova omogočili onemogočene aplikacije ali obvestila;
• ponastavili možnosti aplikacij v privzete nastavitve;
• počistili dovoljenja za aplikacije;
• ponastavili omejitve prenosa podatkov v ozadju za aplikacije.

Podatki aplikacij ne bodo izgubljeni. Možnosti aplikacij za druge uporabnike ne bodo ponastavljene.
